import { StatusBar } from "expo-status-bar";
import React from "react";
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import Icon from 'react-native-vector-icons/MaterialIcons';

import {Profile,Classes,Settings,Games,Modal} from "./Index";
import { NavigationContainer } from "@react-navigation/native";

const Tab = createMaterialBottomTabNavigator();
//const Tab = createBottomTabNavigator();

const BottomTabs = () => {
  // return (
  //   <NavigationContainer>
  //     <Tab.Navigator>
  //           <Tab.Screen name="Home">
  //               {(props) => <HomeScreen  {...props} text={homeText} />}
  //           </Tab.Screen>
  //          <Tab.Screen name="Settings" component={SettingsScreen} />
  //     </Tab.Navigator>
  //   </NavigationContainer>
  // );
  return (
    <Tab.Navigator>
      <Tab.Screen name="Profile" component={Profile}
        options={{
          tabBarIcon:({color}) =>(
            <Icon name="home" color={color} /> 
          ),
        }}
      />
      <Tab.Screen name="Class" component={Classes} 
      />
      <Tab.Screen name="Settings" component={Settings} />
      <Tab.Screen name="Games" component={Games} />
    </Tab.Navigator>
  );
};
/*
<NavigationContainer>
      <Tab.Navigator>
        <Tab.Group>
          <Tab.Screen name="Profile" component={Profile} />
          <Tab.Screen name="Class" component={Classes} />
          <Tab.Screen name="Settings" component={Settings} />
          <Tab.Screen name="Games" component={Games} />
        </Tab.Group>
        <Tab.Group screenOptions={{ presentation: 'modal' }}>
          <Tab.Screen name="Modal" component={Modal} />
        </Tab.Group>
      </Tab.Navigator>
    </NavigationContainer>
*/
export default BottomTabs;
